import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import useFetch from "./useFetch";

const Movie = () => {
    let { id } = useParams();
    const { error, isPending, data } = useFetch(`http://localhost:8000/movie/${id}`);

    return (
      <div>
        {data.name}
      </div>
    );
}

export default Movie;
